Enseignants','Отчет по учителям',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(522,NULL,'Staff List','قائمة الموظفين','工作人员名单','Lista del Personal','Liste du Personnel','Список сотрудников',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(523,NULL,'Report on Staff','تقرير عن الموظفين','工作人员名单报告','Informe sobre el Personal','Rapport sur le Personnel','Отчет о персонале',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(526,NULL,'Wheres My School Report','تقرير أين تقع مدرستي','我的学校在哪里报告','¿Dónde está el Informe de mi Escuela?','Où est mon bulletin scolaire','Отчет “Где моя школа',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(527,'','A Google Earth (KML) file containing all the location of all Institutions','ملف Google Earth (KML) يحتوي على أماكن كل مواقع المؤسسات','一个Google Earth (KML)语法规则文件包含所有学校的地点','Archivo de Google Earth (KML) que contiene la ubicación de todas las Sedes de las Instituciones','Un fichier Google Earth (KML) contenant tous les emplacements de toutes les éltablissements','Google Earth (KML) файл, содержащий расположение всех Учреждение',1,5,'2014-10-27 15:39:35',1,'2014-06-25 15:31:46'),(528,NULL,'Year Book Report','تقريرالكتاب السنوى ','年鉴报告','Informe del Anuario','Rapport annuel ','Отчет Ежегодной Книги',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(530,NULL,'Return Rate','معدل العودة','归还率','Tasa de Rendimiento','Date de retour ','Дата по возращению',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(531,NULL,'Census Discrepancy','تناقض التعداد ','人口调查差异数据','Discrepancia de los datos del Censo','Divergence du Recensement','Несоответствие переписи',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(532,'','Backup files found.','تمّ العثور على ملفات نسخ الاحتياطية.','找到备份文件。','Backup encontrado','Fichiers de sauvegarde trouvés','Резервное копирование файлов найдено.',1,5,'2014-10-23 18:13:15',1,'2014-06-25 15:31:46'),(533,NULL,'Custom','مخصّص','定义表格','Personalizado','Personaliser','Пользовательский',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(534,NULL,'Consolidated','موحَّد','综合','Consolidado','Consolidé','Консолидированный',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(535,NULL,'Data Quality','جودة البيانات','数据质量','Calidad de los datos','Qualité des Données','Качество данных',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(536,NULL,'Summary of School\'s Census Data','موجز بيانات تعداد المدرسة','学校人口普查数据摘要','Resumen de los datos censales de la escuela','Résumé des Données du Recensement de l’Ecole','Резюме данных школы переписи населения',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(537,NULL,'Non-Responsive Schools Report','تقرير المدارس غير المتعاونة','无回复的学校报告','Informe de Escuelas sin responder.','Rapport sur les bulletins scolaires irrecevables','Отчет по школам, неучавствующих в проекте',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(539,NULL,'Data Discrepancy Report','تقرير تناقض البيانات ','数据差异报告','Informe de la Discrepancia de datos','Rapport d’Anomalies de Données','Отчета по данным несоответствия',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(541,NULL,'Number of students (enrollment) by sex, age, locality and grade','عدد الطلاب(المقيدين) حسب النوع والسنّ والموقع والصفّ','学生人数（入学）按性别，年岁，地区和年级','Número de alumnos (matrícula) por sexo, edad, localidad y grado','Nombre d\'étudiants (inscription), par sexe, âge, localité et notes','Количество студентов (зачисленных) по полу, возрасту, местности и уровню образованию',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(542,NULL,'Number of teachers by sex, locality and grade','عدد المعلمين حسب الموقع والنوع والصف','教师人数按性别，地区和年级','Número de profesores por sexo, localidad y grado','Nombre d\'enseignants par sexe, localité et niveau scolaire','Количество учителей по полу, местности и степени',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(544,NULL,'Institutions Report','تقرير المؤسسات','学院报告','Informe de Instituciones ','Rapport des Etablissements','Отчет по Учреждениям',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(551,NULL,'Divide the number of pupils (or students) enrolled who are of the official age group for a given level of education by the population for the same age group and multiply the result by 100. This indicator has dimension values of sex, locality and grade.','قسّم عدد التلاميذ  الملتحقين الذين هم من الفئة العمرية الرسمية لمستوى معين من التعليم على السكان من نفس الفئة العمرية، اجمع واضرب النتيجة في 100  هذا المؤشر له قِيَم البعد للجنس والمكان والصفّ','以同年龄组别受教育程为总人数， 除以达到入学年龄的注册学生人数，再乘以结果的100。该指标包含性别，地区和年级数据。','Se divide el número de alumnos (o estudiantes) matriculados que son del grupo de edad oficial para un determinado nivel de educación por el total de la población para el mismo grupo de edad y se multiplica el resultado por 100. Este indicador tiene valores en las dimensiones de género, localidad y grado.','Diviser le nombre d\'élèves (ou étudiants) inscrits qui sont du groupe d\'âge officiel, à un niveau d\'enseignement donné, par la population de la même tranche d\'âge, et multiplier le résultat par 100. Cet indicateur a des valeurs de dimension de sexe, de localité et de niveau.','Разделите количество зачисленных учащихся (или студентов), в официальный возрастной группе для данного уровня образования на население в той же возрастной группе и умножьте результат на 100. Этот показатель различается по полу, местности и классам.',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(554,NULL,'Divide the number of children of official primary school-entrance age who enter the first grade of primary education for the first time by the population of the same age, and multiply the result by 100. This indicator has dimension values of sex and locality.','قسّم عدد الأطفال في سن المدرسة الرسمية، الذين يدخلون السنة الأولى من المرحلة الابتدائية  لأوّل مرة على السكان من نفس العمر، واضرب النتيجة في 100. هذا المؤشر له قِيَم البعد عن للجنس والمكان','正式的小学入学年龄的儿童进入小学一年级的小学教育，第一次由同年龄的人口数除以，然后将结果乘以100。该指标包含性别和地区数据。','Se divide el número de niños de edad para entrar a primaria que ingresan al primer grado por primera vez por la población de la misma edad, y se multiplica el resultado por 100. Este indicador tiene valores en las dimensiones de sexo y localidad.','Diviser le nombre d\'enfants de l\'école primaire d’âge officiel d\'entrée qui entrent en première année de l\'enseignement primaire pour la première fois par la population du même âge, et multiplier le résultat par 100. Cet indicateur a des valeurs de dimension par rapport au sexe et à la localité.','Разделите число детей официального младшего школьного возраста, которые входом введите первый класс начальной школы в первый раз со стороны населения того же возраста, и умножить результат на 100. Этот показатель имеет размерность значения сексу и местности.',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(556,NULL,'Divide the number of pupils (or students) enrolled in a given level of education regardless of age by the population of the age group which officially corresponds to the given level of education, and multiply the result by 100. This indicator has dimension values of sex, locality and grade.','تقسيم عدد التلاميذ (أو الطلاب) المقيدين في مرحلة معينة من التعليم بغض النظر عن العمر من قبل السكان من الفئة العمرية التي تتطابق رسميا إلى مستوى معين من التعليم، وضرب الناتج في 100. هذا المؤشر له قيم البعد عن الجنس والمكان والصف','划分的学生人数（或学生）参加在给定的教育水平，不论年龄由年龄组正式对应于给定的受教育程度的人口，将结果乘以100。该指标包含性别，地区和年级数据。','Se divide el número de alumnos (o estudiantes) matriculados en un determinado nivel de educación, independientemente de la edad, por el numero total de la población de la edad que oficialmente corresponde al nivel de educación dado, y  se multiplica el resultado por 100. Este indicador tiene valores en las dimensiones de género, localidad y grado.','Diviser le nombre d\'élèves (ou étudiants) inscrits dans un niveau d\'enseignement donné, quel que soit l\'âge correspondant officiellement au niveau d\'enseignement donné, et multiplier le résultat par 100. Cet indicateur a des valeurs de dimension par rapport au sexe, à la localité et au niveau scolaire.','Разделите количество учащихся (или студентов), обучающихся на данном уровне образования, независимо от возраста, на население возрастной группы, которая официально соответствует данному уровню образования, и умножьте результат на 100. Этот показатель различается по полу, местности и классам.',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(557,NULL,'Divide the number of new entrants in grade 1, irrespective of age, by the population of official school-entrance age, and multiply the result by 100. This indicator has dimension values of sex, locality and grade.','قسّم عدد الداخلين الجدد في الصف 1، بغض النظر عن العمر، من قبل السكان في سن المدرسة الرسمية مدخل، ومضاعفة النتيجة عن طريق 100. هذا المؤشر له قيم البعد من المكان والجنس والصف','新进入者的数量除以1级，不论年龄大小，人口的官方学校 - 入学年龄，并且将结果乘以100。该指标包含性别和地区数据。','Se divide el número de entrantes en primer grado, independiente de la edad, por la población total de edad para ingresar a la de la escuela y se multiplica el resultado por 100. Este indicador tiene valores en las dimensiones de género, localidad y grado.','Diviser le nombre de nouveaux entrants en cours préparatoire, indépendamment de l\'âge, selon la population d\'âge officiel de l\'entrée dans l\'école, et multiplier le résultat par 100. Cet indicateur a des valeurs de dimension de sexe, de localité et de niveau.','Разделите число учащихся, поступивших в 1-й класс, независимо от возраста, ',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(559,NULL,'Divide the number of repeaters in a given grade in school year t+1 by the number of pupils from the same cohort enrolled in the same grade in the previous school year t . This indicator has dimension values of sex, locality, sector and grade.','تقسيم عدد من الراسبين في الصف في العام الدراسي نظرا T +1 من قبل عدد من التلاميذ من نفس الفوج المسجلين في الصف نفسه في مدرسة ر العام السابق. هذا المؤشر له قيم البعد بسبب الجنس أو القطاع، ومحلة الصف.','中继器的数量在一个给定的等级，在学年 t +1分的学生人数从同一队列登记在同一个档次上一学年度。该指标包含性别，地区，单位和年级数据。','Se divide el número de repetidores en un grado dado en un año escolar t +1 por el número de alumnos del mismo cohorte matriculados en el mismo grado en la escuela año anterior, t. Este indicador tiene valores en las dimensiones del sexo, localidad, sector y grado.','Diviser le nombre de redoublants dans une classe donnée pour l\'année scolaire t +1 par le nombre d\'élèves du même groupe inscrits dans la même classe durant l’année scolaire précédente. Cet indicateur a des valeurs de dimension de sexe, de localité, de secteur et de niveau d\'éducation.',NULL,1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(561,NULL,'Divide the number of primary graduates, irrespective of age, by the population of theoretical primary graduation, and multiply the result by 100. This indicator has dimension values of sex, locality and sector.','قسّم عدد خريجي المرحلة الابتدائية، بغض النظر عن السنّ، من سكان التخرج الأولية النظرية، واضرب النتيجة في 100. هذا المؤشر له قيم البعد للجنس والموقع المحلي والقطاع','将这个数字的小学毕业生，不论年龄大小，人口理论小学毕业，并且将结果乘以100。该指标包含性别，地区和单位数据。','Se divide el número de graduados de primaria, independientemente de su edad, por la población teóricamente graduada de primaria,  y se multiplica el resultado por 100. Este indicador tiene valores en las dimensiónes de género, localidad y sector.','Diviser le nombre de passage au collège, indépendamment de l\'âge, par la population qui aurait théoriquement du réussir l\'entrée, et multiplier le résultat par 100. Cet indicateur a des valeurs de dimension par rapport au sexe, à la localité et au secteur.','Разделите число выпускников начальной школы, независимо от возраста на теоретическое число выпускников и умножьте результат на 100. Этот показатель различается по полу, местности, секторам.',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(563,NULL,'Divide the total number of pupils belonging to a school-cohort who reached each successive grade of the specified level of education by the number of pupils in the school-cohort i.e. those originally enrolled in the first grade of primary education, and multiply the result by 100. The survival rate is calculated on the basis of the reconstructed cohort method, which uses data on enrolment and repeaters for two consecutive years. This indicator has dimension values of sex, locality and sector.','تقسيم العدد الإجمالي للتلاميذ الذين ينتمون إلى الفوج المدرسي الذي بلغ كل صف المتتالية للمستوى المحدد من قبل التعليم عدد التلاميذ في الفوج المدرسي أي أولئك المنخرطين أصلا في الصف الأول من التعليم الابتدائي، ومضاعفة النتيجة عن طريق 100. يتم حساب معدل البقاء على قيد الحياة على أساس طريقة الفوج أعيد بناؤها، والذي يستخدم بيانات عن معدلات الالتحاق بالمدارس والراسبين لعامين متتاليين. هذا المؤشر له قيم البعد من المكان والجنس والقطاع.','分属于一所学校？队列，每个学校的学生人数在连续级指定的受教育程度达到学生总人数的吗？队列即那些原本就读于一年级的小学教育，将结果乘以100。生存率的计算方法的基础上重建队列方法，它使用了连续两年的入学和中继器的数据。该指标包含性别，地区和单位数据。','Se divide el número total de alumnos que pertenecen a un cohorte escolar que alcanzó cada grado sucesivo del nivel educativo especificado por el número de alumnos en la cohorte escolar es decir, aquellos originalmente inscrito en el primer grado de educación primaria, y se multiplica el resultado por 100. La tasa de supervivencia se calcula sobre la base del método de cohorte reconstruida, que utiliza los datos de matrícula y repetidores por dos años consecutivos. Este indicador tiene valores en las dimensiónes de género, localidad y sector.','Diviser le nombre total d\'élèves appartenant à un groupe d\'écoles ayants atteint chaque année d\'études de manière successives donné par le nombre d\'élèves dans le groupe d\'écoles, c’est-à-dire ceux qui étaient initialement inscrits en première année de l\'enseignement primaire, et multiplier le résultat par 100. Le taux de survie est calculé sur la base de la méthode du groupe reconstitué, qui utilise des données sur les effectifs et les redoublants pour deux années consécutives. Cet indicateur comporte des valeurs de dimension de sexe, de localité et de secteur.','Разделить общее количество учеников, принадлежащих к когорте школы, которые доучились до класса, указанного уровнем образования на количество ',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(565,NULL,'Divide the number of new entrants in the first grade of the specified higher cycle or level of education by the number of pupils who were enrolled in the final grade of the preceding cycle or level of education in the previous school year, and multiply by 100. This indicator has dimension values of sex, locality, sector and grade.','تقسيم عدد الداخلين الجدد في الصف الأول من دورة محددة أو ارتفاع مستوى التعليم من قبل عدد من التلاميذ الذين كانوا مسجلين في الصف النهائي من دورة السابقة أو مستوى التعليم في السنة الدراسية السابقة، وتتضاعف بنسبة 100. هذا المؤشر له قيم البعد بسبب الجنس أو القطاع، ومحلة الصف.','数除以一年级的新进入者在指定的周期或受教育程度的学生被纳入最终成绩的前一个周期或在上一学年的教育水平，再乘以100。该指标包含性别，地区，单位和年级数据。','Se divide el número de nuevos ingresos en el primer grado del ciclo o nivel superior educativo especificado  por el número de alumnos que se inscribieron en grado final del ciclo anterior o el nivel de educación en el anterior año escolar, y se multiplica por 100. Este indicador tiene valores en las dimensiones del sexo, localidad, sector y grado.','Diviser le nombre de nouveaux entrants en première année du cycle supérieur spécifié, ou au niveau scolaire, par le nombre d\'élèves étants inscrits en dernière année du cycle précédent, et multiplier le résultat par 100. Cet indicateur a des valeurs de dimension de sexe, de localité, de secteur et de niveau.','Разделите число учащихся, поступивших в первый класс, указанного ранее цикла или уровня образования на количество учеников, которые были зачислены в последний класс, предшествующего цикла или уровня образования в предыдущем учебном году и умножьте на 100. Этот показатель различается по полу, местности, сектору и классам.',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(567,NULL,'Divide the total number of pupils enrolled at the specified level of education by the number of teachers at the same level. This indicator has dimension values of locality, sector and level of education.','تقسيم العدد الإجمالي للتلاميذ المسجلين في مستوى تعليميا معينا من قبل عدد من المعلمين في نفس المستوى. هذا المؤشر له قيم البعد من القطاع، محلة ومستوى التعليم','总数除以学生人数在指定的受教育程度在同级别的教师人数。该指标包含地区，单位和教育程度数据。','Se divide el número total de alumnos matriculados en el nivel especificado de la educación por el número de profesores en el mismo nivel. Este indicador tiene valores en las dimensiónes de la localidad, sector y nivel de educación.','Diviser le nombre total d\'élèves inscrits au niveau d\'enseignement donné par le nombre d\'enseignants au même niveau. Cet indicateur a des valeurs dimensionnelles sur la localité, le secteur et le niveau d\'éducation.','Разделить общее количество учащихся на определенном уровне образования на число учителей на том же уровне. Этот показатель различается по местности, сектору и уровню образования.',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(571,NULL,'Divide the number of teachers of the specified level of education who have received the minimum required teacher training by the total number of teachers at the same level of education, and multiply the result by 100. This indicator has dimension values of locality, sector and level of education.','قسّم عدد المعلمين من المستوى المعيّن من التعليم الذين حصلوا على الحد الأدنى المطلوب لتدريب المعلمين على العدد الكلي للمعلمين في نفس المستوى من التعليم، واضرب النتيجة في 100. هذا المؤشر له قيم البعد للموقع المحلي والقطاع،  ومستوى التعليم','数除以教师指定级别的教育已经收到了教师总人数的最低要求教师培训在同等水平的教育，然后将结果乘以100。该指标包含地区，单位和教育程度数据。','Se divide el número de profesores del nivel especificado de la educación que han recibido la formación mínima requerida por el número total de docentes en el mismo nivel de educación, y se multiplica el resultado por 100. Este indicador tiene valores de la dimensión de la localidad, sector y nivel de educación.','Diviser le nombre d\'enseignants du niveau spécifié d\'éducation qui ont reçu la formation minimale requise des enseignants par le nombre total d\'enseignants au même niveau d\'éducation, et multiplier le résultat par 100. Cet indicateur a des valeurs dimensionnelles sur la localité, le secteur et le niveau d\'éducation.','Разделите количество учителей, указанного уровня образования, которые ',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(573,NULL,'Divide the number of female students by the number of male students. This indicator has dimension values of sex, locality, sector and level of education.','قسّم عدد الطالبات على عدد الطلاب الذكور. هذا المؤشر له قيم البعد للجنس و الموقع المحلي والقطاع ومستوى التعليم','划分的女性价值的一个给定指标的男性。该指标包含性别，地区，单位和教育程度数据。','Dividir el número de estudiantes de sexo femenino por el número de estudiantes de sexo masculino. Este indicador tiene valores en las dimensiónes del sexo, localidad, sector y nivel de educación.','Diviser le nombre d\'élèves de sexe féminin par le nombre d\'élèves de sexe masculin. Cet indicateur a des valeurs de dimension sur le sexe, la localité, le secteur et le niveau d\'éducation.','Разделите число студенток на количеству студентов мужского пола. Этот показатель различается по полу, местности, сектору и образованию.',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(575,NULL,'Divide the number of female tertiary students enrolled in a specified ISCED level by the total number of students (male plus female) in that level in a given academic-year, and multiply the result by 100. This indicator has dimension values of locality, sector and level of education.','قسّم عدد طالبات التعليم العالي المقيدات في مستوى ISCED معيّن على العدد الكلي للطلاب  (الذكور بالإضافة إلى الإناث) في هذا المستوى في عام دراسيّ معين، واضرب النتيجة في 100. هذا المؤشر له قيم البعد للموقع المحلي والقطاع ومستوى التعليم','ISCED水平在指定的学生总人数（男加女），在一个给定的学术年就读于女性大专学生，将这个数字将结果乘以100。该指标包含地区，单位和教育程度数据。','Se divide el número de mujeres estudiantes de nivel terciario matriculados en un determinado nivel ISCED por el número total de estudiantes (hombres, más mujeres) en ese nivel en un determinado año académico, y se multiplica el resultado por 100. Este indicador tiene valores en las dimensiónes de la localidad, sector y nivel de educación.','Diviser le nombre d\'élèves de sexe féminin inscrits dans l\'enseignement supérieur d\'un niveau spécifié CITE par le nombre total d\'étudiants (masculins et féminins) à ce niveau dans une année universitaire donnée, et multiplier le résultat par 100. Cet indicateur a des valeurs dimensionnelles sur la localité, le secteur et le niveau d\'éducation.',NULL,1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(577,NULL,'Divide the total number of female teachers at a given level of education by the total number of teachers (male and female) at the same level in a given school year, and multiply by 100. This indicator has dimension values of locality, sector and level of education.','قسّم العدد الإجمالي للمعلمات على مستوى معين من التعليم على العدد الكلي للمعلمين (ذكور وإناث) في نفس المستوى في عام دراسي معين، واضرب نتيجة في 100. هذا المؤشر له قيم البعد للموقع المحلي والقطاع ومستوى التعليم','女教师总数除以在给定的教育水平在同级别中一个学年的教师总人数（男，女），再乘以100。该指标包含地区，单位和教育程度数据。','Se divide el número total de mujeres docentes en un nivel educativo determinado por el número total de maestros (hombres y mujeres) en el mismo nivel en un año escolar dado, y se multiplica por 100. Este indicador tiene valores en las dimensiones de la localidad, sector y nivel de educación.','Diviser le nombre total d\'enseignants de sexe féminin à un niveau d\'enseignement donné par le nombre total d\'enseignants (hommes et femmes) au même niveau dans une année scolaire donnée, et multiplier par 100. Cet indicateur a des valeurs dimensionnelles sur la localité, le secteur et le niveau d\'éducation.',NULL,1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(579,NULL,'Divide the number of pupils (or students) enrolled in private educational institutions in a given level of education by total enrolment (public and private) at the same level of education, and multiply the result by 100. This indicator has dimension values of sex, locality and level of education.','قسّم عدد التلاميذ (أو الطلاب) المسجلين في المؤسسات التعليمية الخاصة في مستوى معين من التعليم على خلال الالتحاق الإجمالي (العام والخاص) على نفس المستوى من التعليم، واضرب النتيجة في 100 هذا المؤشر له قيم البعد للجنسوالموقع المحلي ومستوى التعليم','划分的学生人数（或学生）就读于私立教育机构在给定的教育水平同等水平的教育总入学率（公共和私人），然后将结果乘以100。该指标包含性别，地区和教育程度数据。','Se divide el número de alumnos (o estudiantes) matriculados en instituciones educativas privadas en un determinado nivel de educación por la matrícula total (público y privado) en el mismo nivel de educación, y multiplicar el resultado por 100. Este indicador tiene valores de las dimensiónes de género, localidad y nivel de educación.','Diviser le nombre d\'élèves (ou étudiants) inscrits dans des établissements d\'enseignement privés dans un niveau d\'enseignement donné par l\'effectif total (public et privé) au même niveau d\'éducation, et multiplier le résultat par 100. Cet indicateur a des valeurs dimensionnelles sur le sexe, la localité et le niveau d\'éducation.','Разделите количество учащихся (или студентов), обучающихся в частных учебных заведениях на данном уровне образования на общее число учащихся (государственных и частных) на том же уровне образования и умножьте результат на 100. Этот показатель различается по полу, местности, сектору и образованию.',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(581,NULL,'Divide the total number of pupils enrolled at the specified level of education by the number of textbooks at the same level. This indicator has dimension values of locality, and sector.','قسّم العدد الإجمالي للتلاميذ المسجلين في مستوى تعليمي معيَّن على عدد الكتب المدرسية في نفس المستوى. هذا المؤشر له قيم البعد للموقع المحلي والقطاع','总数除以学生人数在指定的受教育程度在同级别的教科书由数量。该指标包含地区和单位数据。','Se divide el número total de alumnos matriculados en un nivel especificado de la educación por el número de libros de texto en el mismo nivel. Este indicador tiene valores en las dimensiones de la localidad y sector.','Diviser le nombre total d\'élèves inscrits au niveau d\'enseignement donné par le nombre de manuels scolaires au même niveau. Cet indicateur a des valeurs dimensionnelles sur la localité et le secteur.','Разделить общее количество учащихся на определенный уровень образования на количество учебников на том же уровне. Этот показатель различается по местности,  и секторам.',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(583,NULL,'Number of water sources by type. This indicator has dimension values of locality, sector and condition.','عدد مصادر المياه وفقا للنوع. هذا المؤشر له قيم البعد للموقع المحلي والقطاع والوضع','水源数量按类型。该指标包含地区，单位和条件数据。','Número de fuentes de agua por tipo. Este indicador tiene valores en las dimensiónes de la localidad, sector y condición.','Nombre de sources d\'eau par type. Cet indicateur a des valeurs dimensionnelles de la localité, de secteur et de condition.','Количество источников воды по типу. Этот показатель различается по местности, сектору и условиям.',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46'),(585,NULL,'Number of sanitation facilities by type. This indicator has dimension values of locality, sector and condition.','عدد المرافق الصحية حسب النوع. هذا المؤشر له قِيَم البعد للموقع المحلي و والقطاع والوضع','卫生设施数量按类型。该指标包含地区，单位和条件数据。','Número de instalaciones de saneamiento por tipo. Este indicador tiene valores en las dimensiónes de la localidad, sector y condición.','Nombre d\'installations sanitaires par type. Cet indicateur a des valeurs de dimension de localité, de secteur et de condition.','Количество санитарных объектов по типу. Этот показатель различается по местности, сектору и условиям.',1,1,'2014-06-25 15:52:55',1,'2014-06-25 15:31:46